INSERT INTO `PastMedicalHistory` (PMhx, ULI, Dx, Gen_Dx) VALUES (-799858810, 325594120, '1. COPD: Severe 2. Hepatitis C: Elizabeth underwent curative treatment in 2016. Her subsequent blood tests have apparently been normal. 3. CHF and pulmonary edema pedal edema 4. Hypertension: 5. Left breast cancer: and has not undergone chemoradiation. She did, however, receive tamoxifen for 5 years postoperatively. 6. Leg edema: In 2016, Elizabeth was found to have progressive bilateral leg edema. She apparently had an echocardiogram, which did not show any acute concerns, including no ventricular dysfunction or pulmonary hypertension. She also apparently had a normal Holter monitor at this time. I do not have access to these results on Netcare today. Elizabeth additionally underwent a CTA to look for flow-limiting peripheral vascular disease; however, there was no evidence of this, just atheroma. Apparently Elizabeth was transitioned to chlorthalidone and has had good symptomatic response to this. She does not report any orthopnea, paroxysmal nocturnal dyspnea, or worsening leg edema. She does not have a history of exertional chest pain or known valvular disease. 7. Hypertension. 8. Dyslipidemia. 9. Cannabis: Occasionally uses about 1 time every 3 months. 10. Carpal tunnel with peripheral intermittent hand cramping: A cervical spine x-ray was also completed to look for central causes of her symptoms. There was some bilateral neural foraminal narrowing at C5-6.', null);
